function addProcSwatch(swatchToGet, colDoc, interal, lab, tint){
	if (!interal){
		var bridgeSwatch = doc.swatches.getByName(swatchToGet);  //changed from CMYKtoPMS_updated
		// var bridgeSwatch = colDoc.getByName(swatchToGet);  //changed from CMYKtoPMS_updated
		// var spotName = bridgeSwatch.color.spot.name.substring(0, bridgeSwatch.color.spot.name.length - 1);  
		var spotName = bridgeSwatch.color.spot.name;  
		var spotValue = bridgeSwatch.color.spot.getInternalColor();
	} else {
		var spotName = swatchToGet;  
		var spotValue = lab;
	}
	// alert(doc.swatches.getByName(spotName))
	try{
		findPMSswatch = doc.swatches.getByName(spotName);
		if (findPMSswatch){
			return findPMSswatch.color
		}
	} catch (e) {
		// alert("error search color "+e)
		var color = new LabColor();
		// alert(spotValue[0]+" "+spotValue[1]+" "+spotValue[2])
		color.l = spotValue[0];
		color.a = spotValue[1];
		color.b = spotValue[2];

		// Source
		// https://community.adobe.com/t5/illustrator-discussions/adding-lab-colors-to-swatch-not-implemented-workaround/m-p/4695352
		var newSpot = app.activeDocument.spots.add();
		newSpot.name = spotName;
		newSpot.colorType = ColorModel.SPOT;
		newSpot.spotKind = SpotColorKind.SPOTLAB;
		newSpot.color = color;
			
		var newSwatch = new SpotColor();
		newSwatch.spot = newSpot;
		if (tint) newSwatch.tint = tint;
		return newSwatch
	}	
} 


