var showAllCalc = false;         // show alerts for all calculations
var diagAlert = false;           // show diagnostic alerts and calculation errors?
var abMax = 127.0;              // Lab ab max should be +127 but Adobe occasionally throws in a +128
var abMin = -128.0;             // Lab ab min (note: CIE math does not limit ab max or min
var dP = 6;                     // Decimal precision for menus Base 10


// ---------------------------------------------
// roundDP()
// pads number to decimal for display
// ---------------------------------------------
function roundDP(num) {
    var r;
    if (diagAlert && isNaN(num))
        alert("roundDP(" + num + ") NaN!");
    r = Math.round(num*dP)/dP; // round input
    return(r);
}
// -------------------------------------------------------
// LabMetrics()        constructor
// -------------------------------------------------------
function LabMetrics(l, a, b) {
    this.l = 0.0;
    this.a = 0.0;
    this.b = 0.0;
    this.error = false;

    if (l != undefined && a != undefined && b != undefined) {
        if (isNaN(l) || isNaN(a) || isNaN(b))
            throw("LabMetrics() Invalid values [" + l + ", " + a + ", " + b + "]");
        this.l = l;
        this.a = a;
        this.b = b;
    }
    if (this.l > 100 || this.l < 0 || this.a > abMax || this.a < abMin || this.b > abMax || this.b < abMin)
        this.error = true;
    return(this);
}

