// Author RAG inc
// Source AdobeCOlorCalculator
// RGB2Lab()
// accepts RGBMetrics, returns LabMetrics
// changed L to l for convenience and consistancy
// -----------------------------------------
function RGB2Lab(RGB) {
    var sc = new SolidColor;
    var Lab, l, a, b;
    var scaleA = 0.5;
    var scaleB = 0.5;
    var msgStr;

    if (!RGB instanceof RGBMetrics)
        throw("RGB2Lab() Invalid RGBMetrics object");
    if (diagAlert && RGB.error)
        alert("RGB2Lab() Invalid RGB Values=[" + RGB.r + ", " + RGB.g + ", " + RGB.b + "]");
    //-------------------------
    // perform the calculations
    //-------------------------
    sc.rgb.red = RGB.r;
    sc.rgb.green = RGB.g;
    sc.rgb.blue = RGB.b;
    //-----------------------------------------------
    // sc assumes ab == -0.5 for neutral colors not 0
    //-----------------------------------------------
    if (sc.lab.a < 0) {
        scaleA = Math.abs(sc.lab.a + 0.5) / 128;
        scaleA = (1 - scaleA) * 0.5;
    } else {
        scaleA = Math.min(127, sc.lab.a + 0.5) / 128;
        scaleA = (1 - scaleA) * 0.5;
        scaleA += sc.lab.a / 127;
        if (sc.lab.a >= abMax - 1)
            scaleA = Math.min(scaleA, abMax - sc.lab.a);
    }
    if (sc.lab.b < 0) {
        scaleB = Math.abs(sc.lab.b + 0.5) / 128;
        scaleB = (1 - scaleB) * 0.5;
    } else {
        scaleB = Math.min(127, sc.lab.b + 0.5) / 128;
        scaleB = (1 - scaleB) * 0.5;
        scaleB += sc.lab.b / 127;
        if (sc.lab.b >= abMax - 1)
            scaleB = Math.min(scaleB, abMax - sc.lab.b);
    }
    //---------------------------------------
    // Use Adobe Solid Color to calculate Lab
    //---------------------------------------
    l = sc.lab.l;
    a = sc.lab.a + scaleA;
    b = sc.lab.b + scaleB;
    Lab = new LabMetrics(l, a, b);
    //-----------------------------
    // check errors and diagnostics
    //-----------------------------
    if (Lab.l == undefined || Lab.a == undefined || Lab.b == undefined ||
        isNaN(Lab.l) || isNaN(Lab.a) || isNaN(Lab.b))
        throw("RGB2Lab() Invalid LAB Values=[" + Lab.l + ", " + Lab.a + ", " + Lab.b + "]");
    if (diagAlert && Lab.error)
        alert("RGB2Lab() Invalid LAB Values:\nRGB[" + roundDP(RGB.r) + ", " + roundDP(RGB.g) + ", " +
              roundDP(RGB.b) + "] = Lab[" +
              roundDP(Lab.l) + ", " + roundDP(Lab.a) + ", " + roundDP(Lab.b) + "]" +
              "\nscale A(" + roundDP(scaleA) + "), scale B(" +  roundDP(scaleB) + ")" +
              "\nSolidColor LAB Values=[" +
              roundDP(sc.lab.l) + ", " + roundDP(sc.lab.a) + ", " + roundDP(sc.lab.b) + "]");
    else if (diagAlert && showAllCalc)
        alert("RGB2Lab() RGB[" + roundDP(RGB.r) + ", " + roundDP(RGB.g) + ", " +
              roundDP(RGB.b) + "] = Lab[" +
              roundDP(Lab.l) + ", " + roundDP(Lab.a) + ", " + roundDP(Lab.b) + "]" +
              "\nscale A(" + roundDP(scaleA) + "), scale B(" +  roundDP(scaleB) + ")" +
              "\nSolidColor LAB Values=[" +
              roundDP(sc.lab.l) + ", " + roundDP(sc.lab.a) + ", " + roundDP(sc.lab.b) + "]");
    return(Lab);
}

